export class InvoicesComponent implements OnInit {
  invoices: any[] = [];
  selectedInvoice: any = null;
  today: Date = new Date();

  constructor(private firestore: Firestore) {}

  async ngOnInit() {
    const snapshot = await getDocs(collection(this.firestore, 'invoices'));
    this.invoices = snapshot.docs.map(doc => {
      const data = doc.data();

      // convert firestore Timestamp to Date if needed
      if (data['date'] && typeof data['date'].toDate === 'function') {
        data['date'] = data['date'].toDate();
      }

      return data;
    });

    // SORT IN DESCENDING ORDER (newest first) - only local in-memory sorting, firestore unchanged
    this.invoices.sort((a, b) => {
      const ta = a.date ? (a.date instanceof Date ? a.date.getTime() : new Date(a.date).getTime()) : 0;
      const tb = b.date ? (b.date instanceof Date ? b.date.getTime() : new Date(b.date).getTime()) : 0;
      if (tb !== ta) return tb - ta; // newer first

      // fallback: try numeric billNo (if applicable), else string compare descending
      const an = parseInt(String(a.billNo).replace(/\D/g, '')) || 0;
      const bn = parseInt(String(b.billNo).replace(/\D/g, '')) || 0;
      if (bn !== an) return bn - an;
      return String(b.billNo).localeCompare(String(a.billNo));
    });
  }

  viewInvoice(billNo: string) {
    this.selectedInvoice = this.invoices.find(i => i.billNo === billNo);
  }

  getDiscountAmount(invoice: any): number {
    const total = invoice.items.reduce((sum: number, i: any) => sum + i.total, 0);
    return Math.round((invoice.discount / 100) * total);
  }

  downloadPDF(billNo: string) {
    // Ensure the invoice DOM exists. If not selected, select it first and wait for DOM render.
    if (!this.selectedInvoice || this.selectedInvoice.billNo !== billNo) {
      this.viewInvoice(billNo);
      // wait a short moment for Angular to render the selectedInvoice section
      setTimeout(() => {
        const element = document.getElementById(`invoice-${billNo}`);
        if (element) {
          html2pdf().from(element).save(`${billNo}.pdf`);
        } else {
          console.warn('Invoice element not found for PDF generation:', billNo);
        }
      }, 120);
    } else {
      const element = document.getElementById(`invoice-${billNo}`);
      if (element) {
        html2pdf().from(element).save(`${billNo}.pdf`);
      } else {
        console.warn('Invoice element not found for PDF generation:', billNo);
      }
    }
  }
}
